  ["batteners"] = "<html><body><h1>batteners</h1><p>battener<p></p>n.<p></p>batten1的变形<p></p>batten2的变形<p></p>batten2<p></p>['bætən]<p></p>vi.<p></p>长肥，喂肥，养肥，发育旺盛，茁壮成长(常与on，upon连用):<p></p>The sheep battened upon the herbage.<p></p>羊靠吃草本植物长肥。<p></p>贪婪地大吃，吃得过多，饱餐，大吃(常与on，upon连用)；<p></p>They battened on the delicious dinner.<p></p>他们大吃美餐。<p></p>(尤指损人利己地)养肥自己，自肥，肥私囊，中饱私囊，损人利己 (常与on， upon连用):<p></p>robber barons who battened on the poor<p></p>靠剥削穷人来养肥自己的强盗贵族<p></p>to batten on the blood of the workers<p></p>榨取工人的血汗来养肥自己<p></p>vt.<p></p>养肥，使肥，喂肥，使发育旺盛；给…喂得过多<p></p>batten1<p></p>['bætən]<p></p>n.<p></p>【建筑学】<p></p>铺室内地板用的木板，长条木(通常规格为长6英尺、宽7英寸、厚2.5英寸)<p></p>压缝条；挂瓦条<p></p>板条，压条<p></p>【造船】<p></p>帆上的短而柔韧的木条，支撑帆用的木棍<p></p>(船上的)扣板，(舱口围框的) 压条，条板，(用以固定盖舱口的油布等的) 板条<p></p>货舱壁护木<p></p>【戏剧】<p></p>(戏院舞台上用作挂电灯、垂幕、布景、背景屏等的) 吊杆[亦作 pipe batten]<p></p>(吊杆支撑的)一排照明灯<p></p>【计算机】警戒孔；(一组卡片的)相同位穿孔<p></p>[亦作 dropper] [新西兰英语] (篱笆中架设电线的)直板条<p></p>vt.<p></p>用压条(或板条、压缝条等)使固定(或加固、钉牢)：<p></p>The worker battened down the loose windows.<p></p>工人用板条钉牢松脱的窗户。<p></p>【航海学】用油布和扣板把(舱口)封住，封舱(常与down连用):<p></p>The tornado is coming, so we had better batten down the hatches here and get to the cellar.<p></p>龙卷风即将来临，因此我们最好把这里的舱口封上，到地下室去。<p></p>【机械学】为加工把(工件)固定在工作台(或机座)<p></p>【建筑学】(用缀合板)装配(钢柱等)<p></p>【戏剧】<p></p>(从吊杆上)吊挂(布景、照明灯等)<p></p>用吊杆固定(背景屏或吊装布景)<p></p>短语:<p></p>batten down the hatches<p></p>见 hatch</p></body></html>",
