  ["bayest"] = "<html><body><h1>bayest</h1><p>bay1<p></p>[bei]<p></p>n.<p></p>(海、湖的)湾，港湾，海湾(通常比 gulf 小些，比 cove 大些)<p></p>(山中的)凹地，山脉低凹处，山间平地，岙，溶蚀洼地<p></p>[美国英语]伸入森林的空地(或草原、沼泽地)<p></p>(美国南部各洲大西洋沿岸)延伸的狭长沼泽地<p></p>同主体隔开的一泓水(如运河闸门外的水地)<p></p>bay2<p></p>[bei]<p></p>n.<p></p>【建筑学】<p></p>开间，架间，跨度；窗柱间距；排架间距；浮桥桥节<p></p>(墙壁的)凹进处，壁龛<p></p>= bay window<p></p>侧厅；耳房，边房；(装窗的)房间突出部分<p></p>(大厅、仓库等内用于专门用途的)分隔间，空间；尤指：<p></p>(谷仓中)堆放谷物(或干草)处<p></p>(畜舍内的)分隔栏，厩<p></p>【航空学】(飞机的)舱，机舱(如放炸弹的弹舱)；(机身的)隔舱；(双翼机的)翼张间<p></p>(维修站、停车场或加油站等中的)停车间，车位，停车泊位<p></p>船上救护室，船上医务室，船上病室(= sick bay)<p></p>[英国英语]【铁路】<p></p>铁路专用支线<p></p>尽头式站台线<p></p>尽头式站台<p></p>【电子学】<p></p>(安装电子器件的)底板，底座，机架，支架<p></p>天线阵元<p></p>【军事】战壕内的通行处<p></p>【计算机】驱动程序机架[亦称作 drive bay]<p></p>bay3<p></p>[bei]<p></p>vi.<p></p>(狗)吠叫，嚎叫；(猎犬追捕猎物时)不断吠叫：<p></p>The hound bayed mournfully.<p></p>猎犬凄厉地嚎叫。<p></p>A hound was baying at the moon.<p></p>狗正对月狂吠。<p></p>大声叫嚷：<p></p>The demonstrators were baying for the resignation of the prime minister.<p></p>游行示威者大声疾呼，要求首相辞职。<p></p>vt.<p></p>向…吠叫(或嚎叫)：<p></p>A troubled hound was baying the moon.<p></p>一条受惊不安的猎狗正在对月狂吠。<p></p>(狗)吠叫着追捕(猎物)，吠叫着进攻：<p></p>A hound bays its quarry.<p></p>猎犬边吠边追逐猎物。<p></p>(猎物等)不使(猎人等)迫近<p></p>把(猎物)围困住，使(猎物)走投无路；迫使作困兽斗，使陷入绝境：<p></p>The hounds bayed the boar.<p></p>一群猎狗把野猪围困住。<p></p>用拖长而沉沉的声调说出：<p></p>The old man bayed a question.<p></p>老人以深沉拖长的声音提出了一个问题。<p></p>n.<p></p>(狗的)吠声，吠叫<p></p>(一群猎犬追逐猎物时)不断的连续的吠叫声<p></p>作困兽斗的局面，走投无路的处境，绝境；受遏制的状况(通常前置 at 或 to )<p></p>短语:<p></p>at bay<p></p>(猎物等) 被困<p></p>处于走投无路的境地<p></p>bay (或 bark at) the moon<p></p>[口语](狂犬)吠月；空嚷，徒劳，枉费心机；不断无谓地抱怨[见 moon]<p></p>bring(或 drive) to bay<p></p>把(猎物等)围困住穷追；使陷入绝境，迫使…作困兽斗，迫使处于走投无路的境地<p></p>keep (或 hold,have)at bay<p></p>控制，牵制<p></p>不使迫近，(猎物等)不使(猎人、猎犬等)迫近；使无法近身<p></p>stand at bay<p></p>作困兽斗<p></p>turn (或 come) to bay<p></p>陷入绝境，作困兽斗，(猎物等)被逼得走投无路时转身自卫<p></p>bay4<p></p>[bei]<p></p>n.<p></p>【植物】<p></p>[亦称 bay tree,sweet bay]月桂(树)(laurus nobilis,欧洲产)(= laurel)<p></p>月桂属(Laurus) 树<p></p>[亦称作 bayberry,bay rum tree]月桂树(Pimenta acris,西印度群岛产)<p></p>类似月桂树的各种树或灌木(如杨梅属、木兰属、山枇花属等)<p></p>(美国)木兰<p></p>[复数]<p></p>桂冠(用月桂树叶编成，旧时用来送给诗人、胜利者)<p></p>荣誉，声誉，名誉<p></p>bay5<p></p>[bei]<p></p>adj.<p></p>(马等)栗色的，枣红色的，赤褐色的<p></p>n.<p></p>(黑鬃黑尾的)栗色马，枣红马<p></p>枣红色牲畜<p></p>栗色，枣红色<p></p>bay6<p></p>[bei]<p></p>n.<p></p>堤，坝<p></p>vt.<p></p>用堤坝拦(水)</p></body></html>",
