  ["behavers"] = "<html><body><h1>behavers</h1><p>behaver<p></p>n.<p></p>behave的变形<p></p>behave<p></p>[bi'heiv]<p></p>vi.<p></p>[后接修饰词语]表现，以某种方式表现；以某种态度对待 (to，towards):<p></p>How did he behave towards you?<p></p>他如何对待你?<p></p>He behaved towards her as a father.<p></p>他像父亲一样对待她。<p></p>Smith behaved like a perfect gentleman.<p></p>史密斯的举止像一位十足的绅士。<p></p>举止端正(或良好、适当)，行为规矩(或得体)，循规蹈矩地行事；听话；有礼貌：<p></p>Why can't that boy behave?<p></p>为什么那男孩不能守规矩呢?<p></p>I wonder if the child has behaved properly.<p></p>我不知道这孩子是否守规矩。<p></p>(机器、汽车、轮船等)运转，运行：<p></p>The ship behaves well.<p></p>这艘船航行得很好。<p></p>(事物等)做出(或起)反应，发生(或起)作用：<p></p>This plastic behaves strangely under extreme heat or cold.<p></p>这种塑料在极热或极冷情况下都会奇怪地起反应。<p></p>vt.<p></p>[behave oneself]检点(自己)的行为，使(自己)举止得当：<p></p>Sit quietly and behave yourself.<p></p>安静地坐着，规矩点。<p></p>[后接修饰词语]使(自己)表现得，使(自己)举止…：<p></p>He behaves himself well.<p></p>他举止得体。<p></p>The soldier behaved with great courage.<p></p>这名战士表现得非常勇敢。<p></p>近义词:<p></p>conduct<p></p>. demean<p></p>. deport<p></p>. comport<p></p>. acquit<p></p>变形：<p></p>vi.<p></p>behaved<p></p>. behaving</p></body></html>",
