  ["benefiters"] = "<html><body><h1>benefiters</h1><p>benefiter<p></p>n.<p></p>benefit的变形<p></p>benefit<p></p>['benifit]<p></p>n.<p></p>利益，好处；帮助；恩惠<p></p>[常用复数](失业、年老、患病等时根据社会保险获得的)保险赔偿费，疾病补助金，退休金，失业救济金，抚恤金，福利金等，非现金补助方案<p></p>义演；义卖；义赛<p></p>[古语]善行，德行，善举；恩典<p></p>[罕用语]利润<p></p>vt.<p></p>行好，为…做好事；援助，帮助，有益于，对…有好处，使得利益：<p></p>行好，为…做好事；援助，帮助，有益于，对…有好处，使得利益：<p></p>That was a health programme to benefit everyone.<p></p>那是一项对人人都有好处的健康计划。<p></p>The new hospital will benefit the entire community.<p></p>新医院将有益于整个社区。<p></p>vi.<p></p>受益，得利，得益，得到好处(常与by， from连用):<p></p>受益，得利，得益，得到好处(常与by， from连用):<p></p>She has never benefited from all that experience.<p></p>她从未得益于那个经验教训。<p></p>Neither of them benefited by what happened.<p></p>他俩谁也没从发生的事情中得益。<p></p>短语:<p></p>benefit(s) in kind<p></p>实物福利(如优待职工购买本厂产品的权利等)<p></p>Benefits please,like flowers,while they are fresh.<p></p>[谚语]恩惠悦人如花朵，满意只在新鲜时。<p></p>for the benefit of someone或for someone's benefit<p></p>为了某人的利益(或好处、缘故)<p></p>为了给某人看(或读、听)<p></p>[用作反语](出于愚弄、刺激等目的)为了让某人明白<p></p>give someone the benefit of one's advice(或 experience,knowledge)<p></p>[讽刺语]用自己的忠告(或经验、知识)来帮助某人<p></p>give someone the benefit of the doubt<p></p>【法律】(在论据不足的情况下)假定某人是无辜的，推定某人是无罪的，未有确证前宁信其无辜<p></p>在没有相反的证据以前暂且信任某人的话(或行为)；尽管对某人有所怀疑但仍然对他做出较为宽大(或有利)的决定；对某人之嫌疑作善意解释<p></p>in benefit<p></p>有资格得到救济金(或补助费、抚恤金、保险金)<p></p>out of benefit<p></p>没资格得到救济金(或补助费、抚恤金、保险金)<p></p>reap the benefit of something<p></p>从某事中获益，因…而获益，因…而得到好处<p></p>the benefit of the doubt<p></p>【法律】<p></p>在罪证不足的情况下被假定为无罪的权利<p></p>在没有相反证据之前给予的肯定判断<p></p>变形：<p></p>vt.<p></p>benefited或benefitted<p></p>. benefiting或benefitting</p></body></html>",
