  ["blessers"] = "<html><body><h1>blessers</h1><p>blesser<p></p>n.<p></p>bless的变形<p></p>bless<p></p>[bles]<p></p>vt.<p></p>(用宗教仪式、祈祷或神迹)使神圣化，使成神圣，使神圣不可侵犯，使圣洁，把…视为神圣；宣布…为圣物：<p></p>The bishop blessed the new church.<p></p>主教为新建成的教堂祝圣。<p></p>The priest bless the offering.<p></p>牧师宣布捐献物为圣物<p></p>为…祝福；为…祈神赐福；为…祈神保佑：<p></p>The minister blessed the congregation.<p></p>牧师为(教堂中的)会众祈神赐福。<p></p>[常用被动语态]赐予，给予，赋予；使享有，使拥有，使具有，使有幸得到(幸福、健康、繁荣或成功等)(常与with连用):<p></p>Fate blessed him with great talent.<p></p>命运之神赋予他伟大的天才。<p></p>to be blessed with eloquence<p></p>有口才<p></p>使幸福；使富裕，使昌盛；赐福于；(上帝)保佑；认为(自己)有福；对…感激：<p></p>God bless you.<p></p>愿上帝保佑你(或你们)，请多保重。<p></p>He blessed us with his leadership.<p></p>在他的领导下，我们很幸福。<p></p>庆幸，幸喜：<p></p>to be blessed with a good appetite<p></p>幸而胃口好<p></p>【宗教】颂扬或赞美(上帝)，对(上帝)感恩：<p></p>to bless the lord<p></p>赞美上帝<p></p>Bless the name of the Lord!<p></p>颂主之圣名!<p></p>在(自己胸前)划十字，对…划十字(为…祈福)：<p></p>to bless the multitude<p></p>为群众祝福<p></p>[口语][表示惊奇]谴责；诅咒，使倒霉：<p></p>I'm blest if I know!<p></p>我一点也不知道呀!<p></p>[除祈祷文、惊叹语等外废语]保佑，保护…使免于(损害、灾难等)，使免遭灾祸：<p></p>to bless oneself from danger<p></p>庆幸自己免遭危险<p></p>批准，核准；赞成，赞同：<p></p>to be blessed by the priests<p></p>得到教会的赞同<p></p>[古语]使受伤；打击<p></p>短语:<p></p>Bless me (或you, him等)!<p></p>(表示惊讶、高兴、沮丧、愤怒等)哎呀!好家伙!我的天哪!<p></p>Bless my soul!<p></p>(表示惊讶、高兴、沮丧、愤怒等)哎呀!我的天哪!<p></p>Bless you!<p></p>上帝保佑你(或你们)!<p></p>长命百岁!(西方风俗：在别人或自己打喷嚏时说)<p></p>God bless (you)!<p></p>[口语](表示良好祝愿、感激)上帝保佑(你)!谢谢<p></p>(God) bless his (或your) soul (或heart)!<p></p>[口语](表示慈爱、感激等感情)太好啦!谢谢!<p></p>I'm blest!<p></p>哎呀! 我的天哪(= Bless me!)<p></p>not have a penny to bless oneself with<p></p>见 penny<p></p>变形：<p></p>vt.<p></p>blessed 或blest<p></p>. blessing</p></body></html>",
