  ["blotters"] = "<html><body><h1>blotters</h1><p>n. absorbent paper used to dry ink<p></p>n. the daily written record of events (as arrests) in a police station</p><p>n. 吸墨纸( blotter的复数形式 ); 临时记录簿, 记事本</p></body></html>",
  ["blottier"] = "<html><body><h1>blottier</h1><p>blotty<p></p>adj.<p></p>blot1的变形<p></p>blot1<p></p>[blɔt]<p></p>n.<p></p>墨水渍；污渍，斑渍，污斑；瑕疵<p></p>不雅观的事物；相形见绌的东西；有损整体美的东西<p></p>(道德品质、品行、名誉等上的)污点；耻辱，不光彩<p></p>vt.<p></p>涂污，玷污，沾染，用(墨水等)弄脏，把…弄脏：<p></p>to blot the paper with ink spots<p></p>将墨水渍弄到纸上<p></p>to blot the desk with a spot of ink<p></p>以墨水渍弄脏书桌<p></p>玷污，污损(名誉等)，使丢脸，使蒙受耻辱：<p></p>to blot his copybook by<p></p>以…玷污了他的名声<p></p>blotted her reputation for fairness<p></p>玷污了她的清白的名誉<p></p>抹掉，擦掉，擦干，去掉，除去：<p></p>memories blotted from one's mind<p></p>被某人遗忘<p></p>to blot the wet table<p></p>擦干潮湿的桌子<p></p>(用吸墨水纸等)吸干，吸去，吸掉：<p></p>to blot the wet ink with a clean blotter<p></p>用吸墨纸吸干湿墨水<p></p>把…弄模糊，使模糊不清；使昏暗；遮蔽，遮暗，弄暗；使黯然失色(out):<p></p>The moon blotted out the sun.<p></p>月亮遮暗太阳。<p></p>消灭；毁坏(out):<p></p>to blot out all the enemies.<p></p>消灭全部敌人。<p></p>vi.<p></p>弄上墨渍(或污渍)，(墨水)渗开，造成污渍；染污：<p></p>The more slowly I write,the more this pen blots.<p></p>我写字越慢，这支钢笔渗墨越多。<p></p>The ink blotted on the paper.<p></p>墨水污染纸张。<p></p>变污，被弄上污渍<p></p>(吸水材料如吸墨纸)吸墨(或染料)，被用吸墨纸吸掉墨水污渍：<p></p>to blot up the ink with this blotting-paper<p></p>用这吸水纸把墨水吸干<p></p>(书写时纸张)洇；(纸等)沾上墨污：<p></p>That paper blots easily.<p></p>那种纸容易洇。<p></p>短语:<p></p>a blot on one's (或the)escutcheon<p></p>名誉上的污点<p></p>a blot on(或upon)the landscape<p></p>破坏风景的东西，破坏自然界的人(或物)，妨碍自然的人(或物)<p></p>有损(或玷污)家庭声誉的人；丢脸的人，没出息的人<p></p>令人扫兴的人(或事)；美中不足之处<p></p>blot one's copybook<p></p>见 copybook<p></p>变形：<p></p>vt.<p></p>blotted<p></p>. blotting</p></body></html>",
